import { mainimage } from '../assets/background1.jpg';

function First() {
  return (
    <div className="first">
      <img className="background_img" src={mainimage} alt="Main" />
      <div className="first__title">
        <div className="text">
          <p>Hi! My name is Yevheniia Levtsun and I’m</p>
          <h1>WEB DEVELOPER</h1>
        </div>
        <div className="located">
          <div className="located__image"></div>
          <p className="located__text"></p>
        </div>
      </div>
      <div className="first__links"></div>
    </div>
  );
}

export default First;
